import React, { useState, useEffect } from "react";
import {
  Container,
  Wrapper,
  Element,
  AddImage,
  AddText,
  Title,
  Content,
} from "./HisElements";
import img from "../../../../images/svg-10.svg";

const His = () => {
  const [data, setdata] = useState(null);
  const fetchData = async () => {
    // eslint-disable-next-line
    const res = await fetch("http://localhost:3002/getanal", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((res) => setdata(res.data));
  };
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      {data === null ? (
        <div>
          <AddImage src={img} alt="noyet"></AddImage>
          <AddText>No data imported yet !</AddText>
        </div>
      ) : (
        <Container>
          <Wrapper>
            <Element>
              <Title>Query: </Title>
              <Content>{data[0].query}</Content>
              <Title>Added on: </Title>
              <Content>{data[0].query}</Content>
            </Element>
          </Wrapper>
        </Container>
      )}
    </>
  );
};

export default His;
